const defaultState = {
    page: false,
  };

  const ACTIVE = "ACTIVE";

  export const PageWomen = (state = defaultState, action) => {
    switch (action.type) {
      case ACTIVE:
        return { ...state, page: action.payload };
      default:
        return state;
    }
  };

  export const pageWomanAction = (payload) => ({ type: ACTIVE, payload });
